import React from "react";

const Home = () => {
  return (
    <div>
      <Form className="d-flex">
        <FormControl
          type="search"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
        />
        <Button variant="outline-success">Search</Button>
      </Form>
      <br />
      <br />
      <br />
      <h1> This is Home </h1>
    </div>
  );
};

export default Home;
